import React,{Component} from 'react';
import {NavLink} from 'react-router-dom';
import {Navbar,Nav} from 'react-bootstrap';
import './M.css';

export class Navigation extends Component{

    render(){
        return(
            <Navbar className="Navi" expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav>
                <NavLink className="d-inline p-2 bg-light text-white" to="/Home">
                    Faqja Kryesore
                </NavLink>
                <NavLink disabled className="d-inline p-2  text-white" to="/personat">
                    Rreth Ne
                </NavLink>
                <NavLink className="d-inline p-2  text-white" to="/Kompania">
                    Kontakti
                </NavLink>
                <NavLink className="d-inline p-2  text-white" to="/Kompania">
                    Ky√ßu
                </NavLink>
                <NavLink className="d-inline p-2  text-white" to="/Kompania">
                    Regjistrohu
                </NavLink>
                </Nav>
                </Navbar.Collapse>
                
            </Navbar>
        )
    }
}
